import React, { Component } from 'react';
import lessoninfall from '../assets/images/lessoninfall.jpeg';

class Home extends Component {
  render() {
    return (
      <div className='background-image' style={{ backgroundImage: `url(${lessoninfall})` }} alt="Horse">
      </div>
    );
  }
};

export default Home;
